import React from 'react';
import { css, jsx } from '@emotion/react';

/** @jsx jsx */

const Navigation = (props) => {

    const { handleClick, direction } = props;

    const btnStyles = css`
        position: absolute;
        top: calc(50% - 25px);
        ${direction === 'left' ? `left: 25px` : `right: 25px`};
        height: 50px;
        width: 50px;
        ${direction === 'left' ? `padding: 5px 5px 0 0` : `padding: 5px 0 0 5px`};
        border: none;
        
        border-radius: 50%;
        
        background: #FFFFFF;
        opacity: .5;
        cursor: pointer;
        transition: opacity .2s ease-in-out;
        
        &:hover {
            opacity: .8;
        }
        
        &:focus {
            outline: none;
        }
        
        & svg {
            height: 25px;
            width: 25px;
            ${direction === 'right' ? `transform: rotate(180deg)` : null};
        }
    `;

    return (
        <button
            css={btnStyles}
            className={'nav'}
            onClick={handleClick}
        >
            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1165 2146"><image width="1153" height="2134" x="6" y="6" xlinkHref="data:img/png;base64,"/></svg>
        </button>
    )
}

export default Navigation;
